import SharedContext from './SharedContext';
import {AppBar, Toolbar, IconButton, Box, TextField} from '@mui/material';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import PersonIcon from '@mui/icons-material/Person';
/*
const styles = {
  rightButtons: {
    float: 'right',
  },
};*/

/**
 * @return {object} JSX
 */
function TopBar() {
  const desktop = false;
  return (
    <SharedContext.Consumer>
      {({mailbox}) => (
        <AppBar position='fixed'>
          <Toolbar sx={{justifyContent: 'space-between'}}>
            <IconButton
              role='button'
              aria-label='toggle drawer'>
              <DensityMediumIcon />
            </IconButton>
            {desktop&&'CSE186 Mail - '+`${mailbox}`}
            <Box component="form">
              <TextField
                margin="normal"
                id="search"
                name="search"

                sx={{background: 'white'}}
              />
            </Box>
            <div>
            <IconButton
              role='button'
              aria-label='compose'>
              <MailOutlineIcon />
            </IconButton>
            <IconButton
              role='button'
              aria-label='compose'>
              <PersonIcon />
            </IconButton>
            </div>
          </Toolbar>
        </AppBar>
      )}
    </SharedContext.Consumer>
  );
}

export default TopBar;
